import React from 'react';
import Button from '@material-ui/core/Button';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';
import useMediaQuery from '@material-ui/core/useMediaQuery';
import { useTheme } from '@material-ui/core/styles';

export default function ResponsiveDialog({ open, setOpen }: { open: boolean, setOpen: any }) {

    const theme = useTheme();
    const fullScreen = useMediaQuery(theme.breakpoints.down('sm'));


    const handleClose = () => {
        setOpen(false);
    };

    return (
        <div>

            <Dialog
                fullScreen={fullScreen}
                open={open}
                onClose={handleClose}
                aria-labelledby="responsive-dialog-title"
            >
                <DialogTitle id="responsive-dialog-title">{"ข้อมูลการสมัคร"}</DialogTitle>
                <DialogContent>
                    <DialogContentText color="primary">
                        ชื่อ: นางสาว  นามสกุล: จังหวัดนนทบุรี
                    </DialogContentText>
                    <DialogContentText color="primary">
                        เลขที่บัตรประชาชน
                    </DialogContentText>
                    <DialogContentText color="primary">
                        ปีเกิด
                    </DialogContentText>
                    <DialogContentText color="primary">
                        เพศ: หญิง
                    </DialogContentText>
                    <DialogContentText color="primary">
                        ระดับการศึกษา:
                    </DialogContentText>
                    <DialogContentText color="primary">
                        อีเมล:
                    </DialogContentText>

                    <DialogContentText color="error" >
                        โปรดตรวจสอบข้อมูลให้ถูกต้อง
          </DialogContentText>
                </DialogContent>
                <DialogActions>
                    <Button autoFocus onClick={handleClose} color="primary">
                        แก้ไขข้อมูล
          </Button>
                    <Button onClick={handleClose} color="primary" autoFocus>
                        ตกลง
          </Button>
                </DialogActions>
            </Dialog>
        </div>
    );
}
